@ardillaaviadora No sé si lo he entendido.
Cuando a mí me diagnosticaron me lo diagnosticó en base a cómo interactuaba con el mundo que me rodea y cómo percibo las cosas, y al margen mi TEPT. 
Y luego tengo el psico rancio que se negó a hacerme los tests que sabe de mi trauma y según él soy NT.

